import React from "react";

const Anasayfa = () => {
  return (
    <div className="header">
      <h2>Teknolojik Yemekler</h2>

      <h1>KOD ACIKTIRIR</h1>
      <h1>PIZZA, DOYURUR</h1>
      <div className="button">
        <button type="button">ACIKTIM</button>
      </div>
    </div>
  );
};
export default Anasayfa;
